import React from 'react';
import styled from 'styled-components';

const HeaderWrap = styled.div`
  display: flex;
  justify-content: space-between;
  background-color: #202327;
  h1 {
    margin-top: 2px;
    margin-bottom: 2px
  }
  ul {
    list-style: none;
    display: flex;
    li {
      margin-left: 2rem;
    }
  }
`;

function Header() {
  return (
    <HeaderWrap>
      <h1>NASA</h1>
      <ul>
        <li>Home</li>
        <li>Selection</li>
        <li>Login</li>
      </ul>
    </HeaderWrap>
  );
}

export default Header;
